R["oh__@kwekweg"]="{['Version']=1769,['TS']=1726660099,['na']={[81]={['N']='Dumb Deadly  Chalet',['O']=19000,['D']='Stupid jump and dive activity plus grumpy humor.',['C']=1.005000,},[28]={['N']='Monster Food Court',['O']=18931,},[15]={['N']='9 Gun Steam Airship',['O']=19911,['D']='General Endare is vain, ruthless, self centered and ambitious.  And those are just her better qualities.  She is also jealous.  Upon hearing of the pirate airship Zubenelgenubi she persuaded Mad Scientist Biro Dar and eccentric Arcanist Azander al Cybiades, on pain of death, to build her an even stronger airship: \"The General Endare\".  The ship fits out right now at a secret base in Grahtwood.  Care to spy on the Butcher?',['C']=1.027000,},[89]={['N']='The Black Cat',['O']=19723,['D']='Tapered Hull Steam/Sail Corvette Black Cat anchored at Alt Universe Medieval Castle.  Easily accessed if you have EHT FX.  Without you need to swim through slaughterfish to the gunwale ladder (I have).  Or beat the system.  The Black Cat will be bad luck for someone. (work in progress).',['C']=1.015000,},[103]={['N']='Zubenelgenubi',['O']=19853,['D']='All know that Redguards have an afinity for technology.  After all, they invented cannons didn\\'t they :)  Here an international gang of pirates have enlisted Mad Scientist Biro Dar to build them an airship raider, the steam powered  \"Zubenelgenubi\" of 10 guns.  Join their merry crew of cutthroats and wreak havoc from the sky.  EHT needed to fire cannons.',['C']=1.027000,},},['eu']={[7]={['N']='Black Vine Horrors',['O']=18510,},},['Key']='oh__@kwekweg',}"
