R["oh__@tulien"]="{['Version']=1773,['Key']='oh__@tulien',['na']={[32]={['D']='A genteel werewolf family lives here, or so the neighbors suspect. Sometimes they see kids playing in the courtyard, but never with any dogs. How to account for all of the barking? It\\'s a mystery.',['N']='Halcyon House',['O']=19224,['C']=1.047000,},[65]={['D']='EHT FX must be enabled to see the build as I intended. This is my homage to the incomparable Netflix series \"Arcane\", which is based on the lore of the League of Legends video game. I don\\'t play League, but I don\\'t need to in order to appreciate a beautiful piece of animation and storytelling. If you haven\\'t seen it, maybe check it out. Yeah. I am not affiliated with Netflix or Riot Games. Just a fan. ;) www.youtube.com/watch?v=fXmAurh012s',['N']='Arcane',['O']=19196,['C']=1.026000,},[38]={['D']='Updated Daggerfall Village! Come and stay a while!',['N']='Daggerfall Village',['O']=19333,['C']=1.041000,},[71]={['D']='A gracious wine estate in Northern Elsweyr. The soil here produces grapes that rival those of the renowned Colovian appellation, but at much lower price point!',['N']='Chateau des Lions',['O']=19508,['C']=1.021000,},[76]={['O']=18939,['N']='...you go first.',},[46]={['D']='OMH Yr 4\\n\\nThank you to all the judges, streamers and housing fans who took the time to visit my house. I am humbled by the talent and the generosity of this community. <3 to all! ',['N']='Gold Coast Arcaneum',['O']=19515,['C']=1.002000,},[47]={['D']='',['N']='Aurbis MiningOutpost',['O']=19777,['C']=1.032000,},[16]={['D']='Tamriel Post',['N']='Tamriel Post',['O']=19002,['C']=1.025000,},[19]={['O']=19971,['N']='Kragenburgers',},[54]={['D']='After ESO, my next passion is Dragon Age. This is a tribute build based on the player character\\'s bedroom at the Skyhold fortress in Dragon Age: Inquisition.\\n\\nLead them or Fall!',['N']='Skyhold Bedroom DA:I',['O']=19294,['C']=1.026000,},[56]={['D']='',['N']='The Oblivion Forge',['O']=19334,['C']=1.