R["oh__@hachikochan"]="{['Key']='oh__@hachikochan',['Version']=1769,['eu']={[16]={['D']='Do you feel hungry?\\r\\nAre you looking for something tasty to eat?\\r\\nThen visit our shop and try the best Italian Pizza in Tamriel! :D',['C']=1.024000,['O']=19095,['N']='The Art of Pizza!',},[17]={['D']='Looking for something warm, cozy and surrended by the nature? \\r\\nThen welcome to your new home in Pineview Cottage! ',['C']=1.033000,['O']=19094,['N']='Pineview Cottage',},[36]={['D']='',['C']=1.035000,['O']=18831,['N']='Summer Retreat',},[23]={['D']='Grab your cup of tea and join me for a walk around the Wagashi Shopping Street in Sleek Creek, made full of sweets only to bright your day, because...\\n\"We love you very MOCHI!\" :D',['C']=1.051000,['O']=19024,['N']='Wagashi Street',},[73]={['O']=18742,['N']='Shopping Street',},[76]={['D']='With the aroma of brewing coffee in the air and a book in my hands, I would like to make you travel in this little town full of life. Welcome to Provence! \\n \\n                             ** Warning **\\n*Please don\\'t visit during sandstorms, I beg you!* Q.Q',['C']=1.041000,['O']=19086,['N']='Provence Town',},[91]={['D']='From the Wizarding World of Harry Potter, welcome to Diagon Alley!',['C']=1.020000,['O']=19013,['N']='Diagon Alley',},[44]={['D']='',['C']=1.051000,['O']=18838,['N']='Japanese Street Food',},[43]={['O']=18767,['N']='Kanazawa District',},[64]={['D']='Welcome to Kurokawa Onsen, a place where anyone would be able to relax, and forget their stress in the beneficial waters of these spa. \\rEnjoy your time!',['C']=1.014000,['O']=18840,['N']='Kurokawa Onsen',},[63]={['D']='Hey everyone jump on the Hogwarts Express for a new Christmas adventure!\\r\\n\\r\\nYou will find Zonko\\'s jokes and tricks to fulfil even Fred and George Weasley\\'s wildest dreams and many others sweetshops! Do you need to send your Christmas Cards or gifts? Don\\'t worry at all! Our Owl Post is always open to send out anything that need to be deli