R["oh__@valinn1"]="{['Key']='oh__@valinn1',['eu']={[32]={['D']='',['N']='Mountains Cottage',['C']=1.021000,['O']=19608,},[49]={['D']='Beware traveler and listen well, \\r\\nhear of my warning, for I will not say it again.\\r\\nThe road through the marshes is dangerous path,\\r\\none step aside and your life will depart…\\r\\nUnless you\\'re lucky enough to wander right into the ivy tower! Here, lost in deep research, lives a kind and smiling witch, always ready to offer a helping hand and a cup of tea! Just don\\'t trample her flowers, okay? She\\'s still a witch, and you may never be found in the surrounding swamp again.\\rNo threat, of course. Tea?',['N']='Ivy Tower',['C']=1.020000,['O']=19665,},[36]={['D']='House in the style of \"The Blue Lagoon\". Make your way through the jungle and find a shack on the shore of an abandoned island. No luxury or modern furnishings, just what the island gives or coast washes up. The lighthouse is no longer in use and access to it is not safe anymore. \\r',['N']='Beach house',['C']=1.035000,['O']=19502,},[63]={['D']='Are you annoyed by the constant long journeys home from your adventures? Then take your home with you!\\r\\nA house economically squeezed into a snow globe that can be stored in any backpack! Unbreakable! Weighs next to nothing! Don\\'t let your house control your life, control your house!',['N']='New Life Snow Globe',['C']=1.500000,['O']=19579,},[71]={['C']=1.500000,['N']='Behind the mirror',['D']='Come and see what lies in the realm behind the mirror, where our desire to change our fate turns into reality. But was the change worth it?',['O']=19876,},[104]={['C']=1.022000,['N']='Let\\'s be a kid again',['D']='',['O']=19859,},[78]={['D']='Townhouse with small front garden and stunning view over the Solitude castle.',['N']='Solitude Townhouse',['C']=1.051000,['O']=19247,},[44]={['D']='Autumn in the streets of Old Town. Come for cup of tea, stay for the atmosphere.',['N']='Streets of Old Town',['C']=1.033000,['O']=19224,},[11]={['D']='Winter rustic cottage. How to survive Tamriel winter with style, in warm and cozy atmosphere. And with hot tea, ofcourse.',['N']='Zimní chatka',['C']=1.036000,['O']=18974,},[12]={['D']='“If I had a world of my own, everything would be nonsense. Nothing would be what it is, because everything would be what it isn\\'t.“',['N']='Madness tea party',['C']=1.020000,['O']=19379,},[17]={['D']='From Northpoint to Shornhelm its the tiresome road,\\r\\nSomewere in the middle, you need refresh your throat.\\r\\nOnce you came to Fell´s Run, you have there options few,\\r\\nBut which one is the best, for someone like you? \\r\\n\\r\\nWho am I kidding, it that even question?\\r\\nYou already know, what is the best option!\\r\\nJust rigth in the center, look across the inn,\\r\\nThe best bakery you can find, so quickly come in!\\r\\n\\r\\nAnd they have coffee too!\\r',['N']='Café and bakery',['C']=1.024000,['O']=19701,},[14]={['D']='',['N']='Enchanted garden',['C']=1.021000,['O']=19362,},[47]={['D']='Once upon a time... An ordinary family, lives in farmhouse on the hills, just a few miles away from the village. Lives they ordinary lifes, until the daughter started hearing voices and having seizures. (the rest at the entrance)',['N']='Ordinary farmhouse',['C']=1.023000,['O']=19602,},},['TS']=1717317971,['Version']=1773,}"
