R["oh__@krel111"]="{['TS']=1717294012,['Key']='oh__@krel111',['na']={[48]={['C']=1.500000,['O']=19874,['D']='House of Nord\\nBe sure to visit the banquet hall above \\nthe throne room.  Portal to Valhalla is in \\nthe dungeons',['N']='Odin\\'s Rest',},[5]={['D']='Alchemy Hut\\nValhalla Crafting Hall Portal Connection',['O']=19875,['C']=1.500000,['N']='Alchemy Hut',},[54]={['C']=1.500000,['O']=19874,['D']='House of Orc.\\nBe sure to visit the crypts,\\nsecond level, and statue of\\nMalacath.  Find the portal to\\nValhalla to explore other \\nfinished homes!',['N']='House of Orc',},[89]={['C']=1.500000,['O']=19874,['D']='Blackwood Living.\\nYour explorations are not complete \\nuntil you\\'ve discovered Pirharri the\\nSmuggler : )\\nYou can find a portal to Valhalla and\\nother finished homes under the stairs \\nin the fort!',['N']='NorthMen\\'s Keep',},[47]={['C']=1.500000,['O']=19875,['D']='Make your way to the\\nend of the maze to find a\\nportal to Valhalla and other\\nfinished homes : )',['N']='Daedric Maze',},[28]={['C']=1.500000,['O']=19874,['D']='The Cabin.\\nFind a portal to Valhalla and other\\nfinished homes in the workshed : )',['N']='Krel\\'s Castle',},[80]={['C']=1.500000,['O']=19874,['D']='Valhalla\\nEnter through the Dwarven crafting hall and fight and feast in Odin\\'s Hall.  Be sure to explore the ice vault and wander outside onto the terrace to view the night sky.  On the terrace you will find portals to other finished homes : )\\nEnjoy!',['N']='Valhalla',},[6]={['C']=1.500000,['O']=19876,['D']='Enchanting Hut\\nValhalla Crafting Hall Portal Connection',['N']='Enchanting Hut',},[95]={['D']='Jewel Crafting Hut\\nValhalla Crafting Hall Portal Connection',['O']=19875,['C']=1.500000,['N']='Jewel Crafting Hut',},},['Version']=1773,}"
