R["oh__@sweetpea704"]="{['Key']='oh__@sweetpea704',['na']={[71]={['D']='I\\'ve always wanted to build a treehouse. This build is three complete buildings, from scratch. I approached it like a puzzle, deciding not to use too much stone, since it would be too heavy for a tree house.  The entire property is decorated so be sure to wander.',['C']=1.031000,['O']=19211,['N']='Elsweyr Meadow',},[22]={['D']='Mara\\'s Wedding Garden is an intimate walled garden for small weddings.  When not in use as a wedding chapel, it is the perfect place to meditate.',['C']=1.021000,['O']=18916,['N']='Laughing Moons House',},[47]={['D']='Turil is a scolar in the Mage\\'s Guild who is obsessed with anything Daedric.  He has made Daedric lore and artifacts his life work. Unfortunately his research opened a portal sending the whole castle to Cold Harbor.  The local inhabitants are not amused. Meanwhile, Turil continues to try and set things right in his lab. It\\'s not going well...',['C']=1.040000,['O']=19345,['N']='Acolyte\\'s Folly',},[15]={['D']='Shimmertarn is a total reskin of The Gorinir Estate into a Druidic Village. It is styled after Glimmertarn in Galen. There are gardens and a village square, surrounded by three houses.  Each home depicts the occupant\\'s occupation. There is a chef, an enchanter, and a craftsperson.',['C']=1.041000,['O']=19345,['N']='Shimmertarn',},[14]={['D']='Search for \"The Shivering Cheese\" in this Raiders of the Lost Ark adventure story. Read the lore book, climb, jump, and avoid obstacles. Beware of skeletons, wild beasts, and traps.',['C']=1.040000,['O']=19408,['N']='Longhaven House',},[63]={['D']='Come and enjoy the winter festival in a European Style market.  Enjoy a sweetroll in the patisserie and talk to the friendly residents.',['C']=1.016000,['O']=19406,['N']='New Life Snow Globe',},},['Version']=1771,['TS']=1676860436,}"
