R["oh__@daltongunlock"]="{['TS']=1664220243,['na']={[16]={['D']='Just a relaxing little spot for those that need to get away from the hustle and bustle of everyday life.',['N']='Mini Retreat',['O']=19261,['C']=1.051000,},[59]={['D']='A summer getaway for yours truly. plus a general meeting place for weary adventurers. Come by and unwind!',['N']='Gunlock Summer Home',['O']=19120,['C']=1.051000,},[36]={['D']='A custom-built combo of Greek and South Florida seaside villa living. Come enjoy the sounds of waves, gulls, and fire crackling as you unwind after a day of adventuring.',['N']='Seaside Villa',['O']=19120,['C']=1.018000,},[4]={['D']='A cozy apartment nestled in Skywatch, with a loft and plenty of reading material.',['N']='Cozy Apartment',['O']=19120,['C']=1.051000,},[94]={['D']='Come book a stay at the Deepwater Resort! Enjoy live entertainment with your meals, get a massage at the spa, and finally retire to either our cozy inn rooms or one of our more secluded courtyard suites. We hope to see you soon!',['N']='Deepwater Resort',['O']=19146,['C']=1.014000,},[79]={['D']='Welcome to the Dungeon, one of Tamriel\\'s few gothic clubs where you need not worry about being fed to hungry vamps, unless that\\'s your thing. Whether on the dance floor, in the VIP section, or in one of the more private alcoves, you\\'re sure to have a great time. \\nSit back, grab a drink, and enjoy the live music and entertainment. Just be sure to keep your hands off the talent, else you risk being sent to the actual dungeon. ',['N']='The Dungeon',['O']=19261,['C']=1.048000,},},['Key']='oh__@daltongunlock',['Version']=1769,}"
