st']=1,['Groups']=0,['EffectType']=5104,['Z']=1731.313901,['SizeX']=9.132570,['X']=1346.958953,['SizeY']=23,['Yaw']=0.436332,['Alpha']=1,['SizeZ']=23,['Color']=999999,},[10]={['Y']=997.080292,['Id']=1030,['Pitch']=4.712564,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=598,['Z']=1106.038666,['SizeX']=50,['X']=571.279336,['SizeY']=64.160584,['Yaw']=0.261799,['Alpha']=1,['SizeZ']=64.160584,['Color']=848484,},[11]={['Y']=1321,['Id']=1032,['Pitch']=1.221730,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=450,['Z']=1008.416069,['SizeX']=128,['X']=1525.958482,['SizeY']=128,['Yaw']=1.658063,['Alpha']=1,['SizeZ']=128,['Color']=999998,},[12]={['Y']=1026,['Id']=1036,['Pitch']=1.570971,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=422,['Z']=873,['SizeX']=512,['X']=1020,['SizeY']=512,['Yaw']=0,['Alpha']=1,['SizeZ']=512,['Color']=148,},[13]={['Color']=629198,['Y']=1044,['Contrast']=1,['Pitch']=1.570971,['Roll']=0,['Id']=1037,['EffectType']=8502,['MetaData']={['message']='The Gray Priest\\'s Hood, which belonged to Daedric Prince Nocturnal many years ago, was stolen by Emer Dareloth, the first Thieves Guild manager. What Dareloth didn\\'t know was that whoever wore this sealed hoodie would have his memory captured by it, erased from history, and his name would never be remembered by anyone who ever met him. By ignorance, Dareloth pulled this hood over his head, disappeared into the shadows as expected. Now his existence is erased from everyone\\'s memory, it belongs only to the hood.\\n\\n\\n\\nThe effect of this curse had a feature that would affect not only Emer, but everyone of his own blood: all his children who were born from now on were also cursed. Emer was a drunk who stopped stealing and wandered from house to house. He had been with many women, but no woman found herself unable to remember who she was with the next day. Only one of these women had successfully given birth. As soon as she saw the child born, she had threw it from her lap and disowned her, devoid of maternal feeling. You ask why? It\\'s not common for a Breton breed to have golden eyes and a cursed seal running down their cheekbones.',['title']='Vol I',},['Z']=981.352575,['SizeX']=26,['X']=1390.394853,['SizeY']=30,['Yaw']=6.094690,['Alpha']=1,['SizeZ']=30,['Groups']=0,},[14]={['Color']=263455,['Y']=996,['Contrast']=1.400000,['Pitch']=0.268781,['Roll']=0,['Id']=1038,['EffectType']=8502,['MetaData']={['message']='Years passed, and loneliness had brought up our hero, Milena, as a thief, just like her unknown father. One day, both of them unaware of each other, Emer and Milena\\'s paths crossed. The moment their eyes met, Milena\\'s eyes gleamed and curse was in burning paing. A cloud covered the air, but something was strange: a purple portal had opened through the clouds? Before anyone knew it, Daedric Prince Nocturnal emerged from the portal and ripped apart Emer with a dark magic. There wasn\\'t even a moment to scream. He tied Milena in red chains and took her captive, they entered the portal together, and then everything went back to the way it was� Except for Milena\\'s life. \\n\\n\\n\\nSince that day, it has been known that no one in the small town has been living in fear as if this incident never happened.\\n',['title']='Vol II',},['Z']=925.258019,['SizeX']=26,['X']=1368.114139,['SizeY']=30,['Yaw']=3.127630,['Alpha']=1,['SizeZ']=30,['Groups']=0,},},}"
